    <NavigationContainer>
      <Stack.Navigator initialRouteName='Home'>
        <Stack.Screen name="Home" component={ HomeScreenPage } />
        <Stack.Screen name="Loginpage" component={ loginpage } />
      </Stack.Navigator>
    </NavigationContainer>
  );
}

export default App;
